// src/LandingPage.jsx
import React from 'react';
import { useNavigate } from 'react-router-dom';

const LandingPage = () => {
  const navigate = useNavigate();

  return (
    <div style={{ padding: '30px' }}>
      <h1 style={{ textAlign: 'center', fontSize: '2.5rem', color: '#007bff' }}>Welcome to Zenventory</h1>
      <div className="container">
        <div className="section">
          <h2>Product Management</h2>
          <p>Manage your product inventory with voice-enabled updates and real-time stock tracking.</p>
          <button onClick={() => navigate('/product')}>Go to Product</button>
        </div>
        <div className="section">
          <h2>Billing System</h2>
          <p>Generate smart bills, apply loyalty discounts, and handle multilingual voice commands.</p>
          <button onClick={() => navigate('/billing')}>Go to Billing</button>
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
